import React, { Component } from "react";

class HomePage extends Component {


    roteSignUp = (e) => {
        this.props.history.push({
            pathname: '/sign-up',
        });
    }

    render() {
        return (
            <div class="div-home-page">
                <div class="background-home-page background-color-pink">
                </div>
                <svg viewbox="0 0 50 50" height="56px">
                    <path d="M1 50 V10 Q1 1 10 1 H50z" fill="#ff4369" />
                </svg>
                <div>
                    <h1 class="title-home-page title-color">Central</h1>
                    <h2 class="sub-title-home-page title-color">de</h2>
                    <h1 class="title-home-page title-color">Erros</h1>

                </div>
                <div class="background-home-page background-color-orange">
                </div>
            </div>


        );
    }
}

export default HomePage;
